g.script:
		 
  function text(text) {
    var helpbox = document.getElementById("helptext__");
    helpbox.textContent = text;
  }
  var helptexts = {
    // Add values here to add help-texts. No HTML allowed.
    // A single line must be used - SVG is börk with multiline strings
    // "svg entity ID": "text on mouse over",
    // Omit comma if it's the last one in the list.
    "path41":  "Q: Quits TPT.",
    "path43":  "W: Sets Gravity Mode (Radial, Vertical, None). Makes STK2 jump, Ctrl+W to override.",
    "path45":  "E: Opens the Element Search menu.",
    "path47":  "R: Records TPT frames. When about to place stamp, Ctrl+R: Rotate stamp clockwise. Ctrl+Shift+R: Flip stamp",
    "path51":  "Y: Set air mode (No Update, Pressure/Velocity Only, On, Off)",
    "path53":  "U: Toggle Ambient Heat mode.",
    "path55":  "I: Invert all pressure. Ctrl+I: Install TPT (ptsave: links, .cps and .stm file types)",
    "path59":  "P: Single screenshot as PNG. Saved next to Powder.exe as image-xxxx.png",
    "path61":  "[: Decreases brush size.",
    "path63":  "]: Increases brush size.",
    "path65":  "A: Moves STK2 to the left if he exists.",
    "path67":  "S: Creates a stamp. Left click to select, right click to cancel. Makes STK2 spew his element, Ctrl+S to override",
    "path69":  "D: Enables Debug View. Useful even while not debugging. Makes STK2 move right, Ctrl+D to override",
    "path71":  "F: Pauses and then updates for one frame. Useful for exploring GOL.",
    "path73":  "G: Enables the grid or makes the grid size larger. Ctrl+G: Disables the grid or makes grid smaller.",
    "path75":  "H: Show/Hide HUD. Doesn't hide menus. Ctrl+H: Show help text.",
    "path79":  "K: Show stamp browser.",
    "path81":  "L: Load last used stamp.",
	"path83":  ";: Toggle replace mode. Ctrl+;: Toggle specific delete mode.",
    "path87":  "Hold Z: Show zoom window around mouse. Hold Z + Click: Place zoom window. Ctrl+Z: Undo.",
    "path89":  "Ctrl+X: Copy save area + delete underneath",
    "path91":  "Ctrl+C: Copy save area",
    "path195": "Ctrl+V: Paste previously copied save area",
    "path93":  "B: Enable Decorations and show decoration menu. Ctrl+B: Toggle Decoration Mode.",
    "path11":  "~: Show Developer console",
    "path13":  "1: Set Viewing Mode to Velocity Display. Shift+1: Set Viewing Mode to Life Display",
    "path15":  "2: Set Viewing Mode to Pressure Display - the more pressure, the redder",
    "path17":  "3: Set Viewing Mode to Persistent Display - trails are shown",
    "path19":  "4: Set Viewing Mode to Fire Display - some elements glow",
    "path21":  "5: Set Viewing Mode to Blob Display - everything's a blur",
    "path23":  "6: Set Viewing Mode to Heat Display - heat makes elements redder",
    "path27":  "7: Set Viewing Mode to Nothing Display - everything is basic",
    "path25":  "8: Set Viewing Mode to Fancy Display - every effect ever",
    "path29":  "9: Set Viewing Mode to Heat Gradient display - trippy gradients for heat deltas",
    "path31":  "0: Set Viewing Mode to Alt Velocity Display - pressure is red, velocity is white",
    "path35":  "=: Reset pressure. Ctrl+=: Reset sparks.",
    "path185": "Space: Pause/Unpause simulation",
    "path105": "Esc: Quits TPT.",
    "path107": "F1: Help text (the same that shows up when you first open TPT)",
    "path149": "Left Arrow: Moves STKM left. Nudges stamps 1 px to the left.",
    "path151": "Down Arrow: Makes STKM spew its element. Nudges stamps 1 px downward.",
    "path153": "Right Arrow: Moves STKM right. Nudges stamps 1 px to the right.",
    "path155": "Up Arrow: Makes STKM jump. Nudges stamps 1 px upward.",
    "path197": "Tab: Changes Brush shape (Triangle, Square/Rectangle, Circle/Ellipse)",
    "path97":  "M: Does absolutely nothing. Promise.",
	"path95":  "N: Toggle Newtonian gravity mode."

  }

  for (var key in helptexts) {
    var svgel = document.getElementById(key);
    if (!svgel)
      continue;
    svgel.setAttribute("fill", "#7A5D8E");
    svgel.onmouseover = function(evt) {
      evt.target.setAttribute("fill", "#9A67BD");
      text(helptexts[evt.target.id]);
    }
    svgel.onmouseout = function(evt) {
      evt.target.setAttribute("fill", "#7A5D8E");
    }
  }
	//

			//
